  return (
    <div className="relative w-[300px] h-[calc(100vh-500px)] mx-auto overflow-hidden scale-150">
      <iframe
        src="https://snack.expo.dev/embedded/@bmojek/react-native-fake-api?iframeId=3rd8w71fwl&amp;preview=true&amp;platform=android&amp;theme=dark"
        className="absolute w-[1000px] h-[calc(100%+500px)] -top-[150px] -left-[715px]"
        title="simulator"
        data-snack-iframe="true"
      ></iframe>
    </div>
  );
}

export default RNFakeRestApi;
